  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Carolina Sandhills
  National Wildlife Refuge summarizes refuge activities for calendar year 1965. The
  report begins with a summary of weather and habitat conditions during the period.
  The wildlife section of the report covers endangered species, threatened species,
  waterfowl, migratory birds, and mammals. A refuge development and maintenance section
  covers physical development, plantings, and fires. Resource management outlines
  grazing, fur harvest, timber removal, and commercial fishing.  The public relations
  section outlines recreational use, refuge visitation, law enforcement and safety.
  Items of interest are provided at the end of the report.\",\n\t\"license_title\":
